webpackJsonp([0xe3a8956080492000],{"./node_modules/json-loader/index.js!./.cache/json/cloud-development-azure.json":function(e,a){e.exports={data:{markdownRemark:{html:"<h2>Microsoft Azure</h2>\n<p>Microsoft Azure (formerly Windows Azure) is a cloud computing service created by Microsoft for building, testing, deploying, and managing applications and services through a global network of Microsoft-managed data centers. It provides software as a service (SaaS), platform as a service (Paas) and infrastructure as a service (Iaas) and supports many different programming languages, tools and frameworks, including both Microsoft-specific and third-party software and systems.</p>\n<h3>Environments</h3>\n<p>Azure provides a wealth of different environment types across the board including OS platforms such as Windows Server and Ubuntu Server, there are a number of variants that can be chosen such as Ubuntu 14.04 or Ubuntu 16.10, with the ability to use said environments either via the built-in Azure Web CLI or SSH access via your preferred client.</p>\n<p>There are varying levels of machine ‘sizes’ to choose from, ranging from simple barebone low spec machines all the way up multi-GPU and multi-CPU based heavy hitting boxes.</p>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<ul>\n<li><a href='https://en.wikipedia.org/wiki/Microsoft_Azure' target='_blank' rel='nofollow'>Wikipedia</a></li>\n</ul>",fields:{slug:"/cloud-development/azure/"},frontmatter:{title:"Azure"}}},pathContext:{slug:"/cloud-development/azure/"}}}});
